import {BrowserRouter as Router,
    Routes,
    Route
} from 'react-router-dom';

import Sidebar from './components/Sidebar';

import Chat from './Pages/Chat';


function App() {
  return (
    <Router>
      <Sidebar/>
      <Routes>
        <Route path='/' element={<Chat/>} />
      </Routes>
    </Router>
  )
}

export default App
